import React from "react";
import { motion, useViewportScroll, useTransform } from "framer-motion";

import "./Shapes.scss";

const Shapes = () => {
  const { scrollYProgress } = useViewportScroll();
  const y1 = useTransform(scrollYProgress, [0, -1600], [0, -1600]);

  return (
    <motion.div className="app__shapes-container" style={{ y: y1, x: 150 }}>
      <motion.div
        // style={{
        //   scaleY: scrollYProgress,
        // }}
        // initial={{ y: scrollYProgress }}
        // animate={{ y: 1000 }}
        style={{ y: y1, x: 150 }}
      >
        <i className="fa-brands fa-react fa-5x"></i>
      </motion.div>
    </motion.div>
  );
};

export default Shapes;
